class JuegosPS4Component {
    constructor(productoSvc, pruebaService, router) {
        this.productoSvc = productoSvc;
        this.pruebaService = pruebaService;
        this.router = router;
        this.rango = '0';
        this.filterProducto = '';
        this.dolar = false;
        this.load = false;
    }
    ngOnInit() {
        this.productoSvc.catalogo = true;
        this.productoSvc.search = false;
        setTimeout(() => {
            this.load = true;
        }, 1000);
        if (this.productoSvc.termino) {
            this.filterProducto = this.productoSvc.termino;
        }
        if (this.productoSvc.fisicos === true) {
            this.juegos = '';
            this.productoSvc.loadPhysicalProducts()
                .subscribe(res => {
                this.juegos = res[0];
            });
        }
        if (this.productoSvc.ofertas === true) {
            this.productoSvc.termino = '';
            this.juegos = '';
            this.productoSvc.loadGamesForOffer()
                .subscribe(res => {
                this.juegos = res;
            });
        }
        if (this.productoSvc.ofertas === false && this.productoSvc.fisicos === false
            || this.productoSvc.ofertas === undefined || this.productoSvc.fisicos === undefined) {
            this.pruebaService.cargarElementos().subscribe(res => {
                this.juegos = res;
                this.alfabetico = res;
                this.cantidad = this.juegos.length;
                //console.log(this.juegos);
            });
        }
        if (this.productoSvc.divisa === 'USD') {
            this.dolar = true;
            this.productoSvc.loadDolarValue()
                .subscribe(res => {
                this.precioDolar = res;
                // tslint:disable-next-line: radix
                this.usd = parseInt(this.precioDolar.dolar);
            });
        }
        else {
            this.dolar = false;
        }
    }
    value(event) {
        this.rango = event;
    }
    findPrice(valor) {
        this.productoSvc.termino = '';
        this.filterProducto = '';
        // tslint:disable-next-line: radix
        const cantidad = parseInt(valor);
        this.juegos = '';
        this.productoSvc.loadGamesForPrice(cantidad)
            .subscribe(resp => {
            this.juegos = resp;
        });
    }
    divisaSelected(event) {
        if (event === 'USD') {
            this.dolar = true;
            this.productoSvc.divisa = event;
            this.productoSvc.loadDolarValue()
                .subscribe(res => {
                this.precioDolar = res;
                // tslint:disable-next-line: radix
                this.usd = parseInt(this.precioDolar.dolar);
            });
        }
        else {
            this.dolar = false;
        }
    }
    openGame(juego) {
        // console.log(juego);
        if (juego.cantPpal === 0 && juego.cantSec === 0) {
            sweetalert2__WEBPACK_IMPORTED_MODULE_1___default.a.fire('Agotado', 'Pronto tendremos de nuevo este título', 'question');
        }
        else {
            this.router.navigate([`/detalle/${juego.id}`]);
        }
    }
    btnSearch(cate) {
        this.productoSvc.termino = '';
        this.filterProducto = '';
        this.juegos = '';
        this.productoSvc.loadByCategory(cate)
            .subscribe(res => {
            this.juegos = res;
        });
    }
    loadAllgames() {
        this.productoSvc.termino = '';
        this.juegos = '';
        this.filterProducto = '';
        this.pruebaService.cargarElementos().subscribe(res => {
            this.juegos = res;
            this.alfabetico = res;
            this.cantidad = this.juegos.length;
        });
    }
    loadOffergames() {
        this.filterProducto = '';
        this.productoSvc.termino = '';
        this.juegos = '';
        this.productoSvc.loadGamesForOffer()
            .subscribe(res => {
            this.juegos = res;
        });
    }
    filtrarBusqueda(event) {
        this.juegos = [];
        if (event === 'alfabetico') {
            this.juegos = this.alfabetico;
        }
        if (event === 'fecha') {
            this.pruebaService.CargarElementosFecha().then(res => {
                this.juegos = res;
                this.cantidad = this.juegos.length;
            });
        }
        if (event === 'menor') {
            this.pruebaService.CargarElementosPrecioMmenor().then(res => {
                this.juegos = res;
                this.cantidad = this.juegos.length;
            });
        }
        if (event === 'mayor') {
            this.pruebaService.CargarElementosPrecioMayor().then(res => {
                this.juegos = res;
                this.cantidad = this.juegos.length;
            });
        }
    }
}
